module.exports = {
  parser: '@typescript-eslint/parser',
  plugins: [
    'import',
    'cypress',
    'jsx-a11y',
    'react',
    'react-hooks',
    'prettier',
    '@typescript-eslint',
  ],
  extends: [
    'standard',
    'standard-jsx',
    'plugin:import/errors',
    'plugin:import/warnings',
    'plugin:import/typescript',
    'plugin:react/recommended',
    'plugin:cypress/recommended',
    'plugin:jsx-a11y/recommended',
    'plugin:prettier/recommended',
    'plugin:@typescript-eslint/eslint-recommended',
    'plugin:@typescript-eslint/recommended',
    'prettier',
    'plugin:storybook/recommended',
  ],
  rules: {
    'no-else-return': ['error', { allowElseIf: false }],
    'prettier/prettier': 'error',
    'react-hooks/rules-of-hooks': 'error',
    'react/jsx-fragments': ['error', 'element'],
    'react/prop-types': 'off',

    'no-useless-constructor': 'off', // buggy

    // buggy, handled better by no unused imports and actual build
    'import/no-unresolved': 'off',

    // handled by prettier
    'react/jsx-curly-newline': 'off',
    'react/jsx-indent': 'off',

    '@typescript-eslint/no-namespace': 'off',
    '@typescript-eslint/no-empty-function': 'off',
    '@typescript-eslint/explicit-function-return-type': [
      'error',
      {
        allowExpressions: true,
      },
    ],
    '@typescript-eslint/no-unused-vars': [
      'error',
      {
        ignoreRestSiblings: true,
      },
    ],
    'no-use-before-define': 'off',
    '@typescript-eslint/no-use-before-define': ['error'],
    'array-callback-return': 'off',
  },
  overrides: [
    {
      files: ['*.js', '*.jsx'],
      rules: {
        '@typescript-eslint/explicit-function-return-type': 'off',
        '@typescript-eslint/explicit-module-boundary-types': 'off',
      },
    },
    {
      files: ['*.d.ts'],
      rules: {
        '@typescript-eslint/no-unused-vars': 'off',
      },
    },
  ],
  settings: {
    react: { version: 'detect' },
  },
  env: {
    'cypress/globals': true,
  },
  globals: {
    beforeAll: 'readonly',
    afterAll: 'readonly',
  },
}

{
  "extends": "stylelint-config-standard"
}

build: while true; do make -qs bin/goalert.cover || make bin/goalert.cover || (echo '\033[0;31mBuild Failure'; sleep 3); sleep 0.1; done

